local orbitRadius = 6
local orbitAngle = 0
local orbitSpeed = 120

-- Split function for arguments
local function split(str)
    local t = {}
    for word in str:gmatch("%S+") do
        table.insert(t, word)
    end
    return t
end

-- Helper functions
local function SmoothTeleport(toCFrame)
    local character = LocalPlayer.Character
    if not character or not character:FindFirstChild("HumanoidRootPart") then return end
    local hrp = character.HumanoidRootPart
    -- Увеличена длительность с 1 до 3 секунд для более медленной телепортации
    local tweenInfo = TweenInfo.new(3, Enum.EasingStyle.Quad, Enum.EasingDirection.Out)
    local tween = TweenService:Create(hrp, tweenInfo, {CFrame = toCFrame})
    tween:Play()
end

local function StartSpin()
    if isSpinning then return end
    isSpinning = true
    local character = LocalPlayer.Character
    if not character or not character:FindFirstChild("HumanoidRootPart") then return end
    local hrp = character.HumanoidRootPart
    spinConnection = RunService.Heartbeat:Connect(function(dt)
        hrp.CFrame = hrp.CFrame * CFrame.Angles(0, math.rad(180 * dt), 0)
    end)
end

local function StopSpin()
    isSpinning = false
    if spinConnection then
        spinConnection:Disconnect()
        spinConnection = nil
    end
end

-- Player shake (character trembles)
local function StartPlayerShake()
    if isShaking then return end
    isShaking = true
    local character = LocalPlayer.Character
    if not character or not character:FindFirstChild("HumanoidRootPart") then return end
    local hrp = character.HumanoidRootPart
    shakeConnection = RunService.Heartbeat:Connect(function()
        local offsetX = math.random(-8, 8) / 10
        local offsetY = math.random(-5, 5) / 10
        local offsetZ = math.random(-8, 8) / 10
        hrp.CFrame = hrp.CFrame * CFrame.new(offsetX, offsetY, offsetZ)
    end)
end

local function StopPlayerShake()
    isShaking = false
    if shakeConnection then
        shakeConnection:Disconnect()
        shakeConnection = nil
    end
end

-- Orbit around target player
local function StartOrbit()
    if isOrbiting then return end
    isOrbiting = true
    local character = LocalPlayer.Character
    if not character or not character:FindFirstChild("HumanoidRootPart") then return end
    local hrp = character.HumanoidRootPart

    orbitConnection = RunService.Heartbeat:Connect(function(dt)
        local targetChar = TargetPlayer.Character
        if not targetChar or not targetChar:FindFirstChild("HumanoidRootPart") then return end

        local targetPos = targetChar.HumanoidRootPart.Position

        orbitAngle = orbitAngle + math.rad(orbitSpeed * dt)
        
        local offset = Vector3.new(
            math.cos(orbitAngle) * orbitRadius,
            0,
            math.sin(orbitAngle) * orbitRadius
        )
        
        local rayOrigin = Vector3.new(targetPos.X + offset.X, targetPos.Y + 50, targetPos.Z + offset.Z)
        local rayDirection = Vector3.new(0, -100, 0)
        local raycastParams = RaycastParams.new()
        raycastParams.FilterType = Enum.RaycastFilterType.Blacklist
        raycastParams.FilterDescendantsInstances = {character}
        
        local raycastResult = workspace:Raycast(rayOrigin, rayDirection, raycastParams)
        
        if raycastResult then
            hrp.CFrame = CFrame.new(raycastResult.Position + Vector3.new(0, 3, 0), targetPos)
        else
            local groundPos = Vector3.new(targetPos.X + offset.X, targetPos.Y, targetPos.Z + offset.Z)
            hrp.CFrame = CFrame.new(groundPos, targetPos)
        end
    end)
end

local function StopOrbit()
    isOrbiting = false
    if orbitConnection then
        orbitConnection:Disconnect()
        orbitConnection = nil
    end
end

local function RainbowScreen()
    if colorCorrection then return end
    colorCorrection = Instance.new("ColorCorrectionEffect")
    colorCorrection.Parent = Lighting
    local hue = 0
    rainbowConnection = RunService.Heartbeat:Connect(function(dt)
        if not colorCorrection then
            rainbowConnection:Disconnect()
            return
        end
        hue = (hue + dt * 80) % 360
        colorCorrection.TintColor = Color3.fromHSV(hue / 360, 1, 1)
    end)
end

local function NormalScreen()
    if colorCorrection then
        colorCorrection:Destroy()
        colorCorrection = nil
    end
    if rainbowConnection then
        rainbowConnection:Disconnect()
        rainbowConnection = nil
    end
end

