local function PlaySoundOnce()
    if sound then 
        sound:Stop() 
        sound:Destroy() 
        sound = nil
    end
    
    sound = Instance.new("Sound")
    sound.SoundId = "rbxassetid://85271883712040"
    sound.Volume = 5
    sound.Looped = false
    sound.Parent = SoundService
    sound:Play()
    
    sound.Ended:Connect(function()
        if sound then
            sound:Destroy()
            sound = nil
        end
    end)
end

