local function Particles()
    local char = LocalPlayer.Character
    if not char or not char:FindFirstChild("HumanoidRootPart") or particleEmitter then return end
    particleEmitter = Instance.new("ParticleEmitter")
    particleEmitter.Texture = "rbxassetid://243660364"
    particleEmitter.Rate = 120
