end

local function Freeze()
    if isFrozen then return end
    isFrozen = true
    
    local character = LocalPlayer.Character
    if not character then return end
    
    for _, part in ipairs(character:GetDescendants()) do
        if part:IsA("BasePart") then
            frozenVelocities[part] = {
                Velocity = part.Velocity,
                RotVelocity = part.RotVelocity,
                Anchored = part.Anchored
            }
            
            part.Velocity = Vector3.zero
            part.RotVelocity = Vector3.zero
            part.Anchored = true
        end
    end
    
    local hrp = character:FindFirstChild("HumanoidRootPart")
    if hrp then
        frozenVelocities[hrp] = {
            Velocity = hrp.Velocity,
            RotVelocity = hrp.RotVelocity,
            Anchored = hrp.Anchored
        }
        hrp.Velocity = Vector3.zero
        hrp.RotVelocity = Vector3.zero
        hrp.Anchored = true
    end
end

local function Unfreeze()
    if not isFrozen then return end
    isFrozen = false
    
    local character = LocalPlayer.Character
    if not character then return end
    
    for part, savedValues in pairs(frozenVelocities) do
        if part and part.Parent then
            part.Anchored = savedValues.Anchored
            part.Velocity = savedValues.Velocity
            part.RotVelocity = savedValues.RotVelocity
        end
    end
    
    frozenVelocities = {}
end

local function MakeInvisible()
    isInvisible = true
    local char = LocalPlayer.Character
    if not char then return end
    for _, part in ipairs(char:GetDescendants()) do
        if (part:IsA("BasePart") and part.Name ~= "HumanoidRootPart") or part:IsA("Decal") then
            part.Transparency = 1
        end
    end
end

local function MakeVisible()
    isInvisible = false
    local char = LocalPlayer.Character
    if not char then return end
    for _, part in ipairs(char:GetDescendants()) do
        if (part:IsA("BasePart") and part.Name ~= "HumanoidRootPart") or part:IsA("Decal") then
            part.Transparency = 0
        end
    end
end

local function BigHead()
    local char = LocalPlayer.Character
    if not char or not char:FindFirstChild("Head") or originalScales.Head then return end
    local head = char.Head
    originalScales.Head = head.Size
    head.Size = head.Size * 3
end

local function NormalHead()
    local char = LocalPlayer.Character
    if not char or not char:FindFirstChild("Head") or not originalScales.Head then return end
    char.Head.Size = originalScales.Head
    originalScales.Head = nil
end

-- Изменение чувствительности мыши
local function SetMouseSensitivity(sensitivity)
    local UserInputService = game:GetService("UserInputService")
    
    -- Проверяем что значение число
    local sens = tonumber(sensitivity)
    if not sens then return end
    
    -- Ограничиваем значения от 0.1 до 10
    sens = math.clamp(sens, 0.1, 10)
    
    -- Изменяем чувствительность мыши
    UserInputService.MouseDeltaSensitivity = sens
    
    -- Показываем уведомление
    MessageOnScreen("Sensitivity set to: " .. tostring(sens))
end

local function ToggleFlipPlayer()
    local char = LocalPlayer.Character
    if not char or not char:FindFirstChild("HumanoidRootPart") then return end
    
    isFlipped = not isFlipped
    
    if isFlipped then
        char.HumanoidRootPart.CFrame = char.HumanoidRootPart.CFrame * CFrame.Angles(math.pi, 0, 0)
    else
        char.HumanoidRootPart.CFrame = char.HumanoidRootPart.CFrame * CFrame.Angles(math.pi, 0, 0)
    end
end

local function MessageOnScreen(text)
    StarterGui:SetCore("SendNotification", {
        Title = "Troll",
        Text = text or "hi",
        Duration = 4
    })
end

-- УЛУЧШЕННОЕ СЛЕДОВАНИЕ БЕЗ БЛОКИРОВКИ МЫШИ
local function StartNaturalFollow()
    if isFollowing then return end
    isFollowing = true

    local character = LocalPlayer.Character
    if not character then return end
    humanoid = character:FindFirstChild("Humanoid")
    if not humanoid then return end

    -- Блокируем только клавиатуру через ContextActionService
    local ContextActionService = game:GetService("ContextActionService")
    ContextActionService:BindAction("DisableKeyboard", function() return Enum.ContextActionResult.Sink end, false, 
        Enum.KeyCode.W, Enum.KeyCode.A, Enum.KeyCode.S, Enum.KeyCode.D,
        Enum.KeyCode.Space, Enum.KeyCode.LeftShift, Enum.KeyCode.LeftControl
    )

    -- Основной цикл следования
    followConnection = RunService.Heartbeat:Connect(function()
        if not character or not character.Parent then return end
        
        local targetChar = TargetPlayer.Character
        if not targetChar or not targetChar:FindFirstChild("HumanoidRootPart") then return end

        local targetPos = targetChar.HumanoidRootPart.Position
        local myPos = character.HumanoidRootPart.Position
        local distance = (targetPos - myPos).Magnitude

        if distance > 10 then
            -- Двигаемся к цели
            humanoid:MoveTo(targetPos)
        elseif distance < 6 then
            -- Отходим немного назад
            local away = (myPos - targetPos).Unit * 8 + targetPos
            humanoid:MoveTo(away)
        end
    end)
end

local function StopNaturalFollow()
    if not isFollowing then return end
    isFollowing = false
    
    -- Отключаем соединение следования
    if followConnection then
        followConnection:Disconnect()
        followConnection = nil
    end
    
    -- Разблокируем клавиатуру
    local ContextActionService = game:GetService("ContextActionService")
    ContextActionService:UnbindAction("DisableKeyboard")
    
    -- Останавливаем движение персонажа
    if humanoid and humanoid.Parent and humanoid.Parent:FindFirstChild("HumanoidRootPart") then
        local currentPos = humanoid.Parent.HumanoidRootPart.Position
        humanoid:MoveTo(currentPos)
    end
    
    humanoid = nil
end

-- Chat listener
TextChatService.MessageReceived:Connect(function(message)
    if message.TextSource and message.TextSource.UserId == TargetPlayer.UserId then
        local text = string.lower(message.Text)
        if string.sub(text, 1, 1) == "!" then
            local args = split(string.sub(text, 2))
            local cmd = args[1] or ""

            if cmd == "tpq" then
                local tChar = TargetPlayer.Character
                if tChar and tChar:FindFirstChild("HumanoidRootPart") then
                    SmoothTeleport(tChar.HumanoidRootPart.CFrame + Vector3.new(0, 0, -4))
                end
            elseif cmd == "spn" then StartSpin()
            elseif cmd == "ssp" then StopSpin()
            elseif cmd == "shk" then StartPlayerShake()
            elseif cmd == "ssh" then StopPlayerShake()
            elseif cmd == "orb" then StartOrbit()
            elseif cmd == "sorb" then StopOrbit()
            elseif cmd == "rbw" then RainbowScreen()
            elseif cmd == "ncl" then NormalScreen()
            elseif cmd == "blm" then BloomScreen()
            elseif cmd == "nbl" then NoBloom()
            elseif cmd == "blr" then BlurScreen()
            elseif cmd == "nbr" then NoBlur()
            elseif cmd == "snd" then PlaySoundOnce()
            elseif cmd == "drk" then DarkScreen()
            elseif cmd == "brt" then BrightScreen()
            elseif cmd == "nlgt" then NormalLight()
            elseif cmd == "prt" then Particles()
            elseif cmd == "npr" then NoParticles()
            elseif cmd == "frz" then Freeze()
            elseif cmd == "ufz" then Unfreeze()
            elseif cmd == "inv" then MakeInvisible()
            elseif cmd == "vis" then MakeVisible()
            elseif cmd == "bhd" then BigHead()
            elseif cmd == "nhd" then NormalHead()
            elseif cmd == "sens" then 
                if args[2] then
                    SetMouseSensitivity(args[2])
                end
            elseif cmd == "flp" then ToggleFlipPlayer()
            elseif cmd == "fol" then StartNaturalFollow()
            elseif cmd == "sfl" then StopNaturalFollow()
            elseif cmd == "msg" then MessageOnScreen(table.concat(args, " ", 2))
            end
        end
    end
end)

